import React from 'react';
import Link from 'next/link';

class Index extends React.Component {
    // constructor
    constructor(props) {
        super(props);
    }

    // render display
    render () {
        return (
            <div className="container">
                <div className="navbar">
                    <Link href="/about">
                        <a>HOME</a>
                    </Link>
                    <Link href="/about">
                        <a>ABOUT</a>
                    </Link>
                    <Link href="/about">
                        <a>SEARCH</a>
                    </Link>
                </div>
                <div className="content">

                </div>

            <style jsx>{`
                .container {
                    font-family: Roboto;
                }

                .navbar {
                    background-color: black;
                    height: 36px;
                }

                a {
                    float: left;
                    padding-left: 10px;
                    text-decoration: none;
                }
            `}</style>
            </div>
        );
    }
}

export default Index;
